import React, { Component } from 'react';
import '../css/Content-homepage.css';
import "antd/dist/antd.css";
import {Row,Col } from 'antd';
import {Container, } from 'react-bootstrap';

class ContentHompage extends Component{
    render() {
        return(
              <div>
                  <Container>
                      <Row>
                          <Col lg={16} className="featured-news">

                          </Col>

                          <Col lg={8} className="featured-banner-hot-top-fr pr-lg-0">
                              <Row>
                                  <ul className="list-group list-group-flush">
                                      <li className="list-group-item">
                                          <Row>
                                          <Col lg={10} className=" pr-lg-1">
                                              <a href="#"><img className="img-fluid" src="https://znews-photo.zadn.vn/w660/Uploaded/pgi_dhbpgunat/2019_02_26/APTOPIX_Trump_54438jpg28d7d_c013519441268_s885x516.jpg" alt=""/></a>
                                          </Col>

                                          <Col lg={14}>
                                              <h4 className="title-text-item-content-fl">
                                                  <a href="#">Tổng thống Trump lên Air Force One để tới Việt Nam</a>
                                              </h4>
                                          </Col>
                                          </Row>
                                      </li>
                                  </ul>
                              </Row>
                          </Col>
                      </Row>
                  </Container>
              </div>
        );
    }
}
export default ContentHompage;
